import React, { createElement } from 'react';
import './css/Button.css';

function Button() {
  this.textInput = React.createRef();
  this.textInput.current.focus();
  return (
    <div>
      <a href="#" className="button">
        Button
      </a>
      <input ref={this.textInput} />
    </div>
  );
}

export default Button;
